{% block title %}Message index{% endblock %}

{% block body %}
    <h1>Message index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>User</th>
                <th>Categories</th>
                <th>Body</th>
                <th>Creation_date</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for message in messages %}
            <tr>
                <td>{{ message.user.name }}</td>
                <td>
                    {% for category in message.categories %}
                    [{{ category }}]
                    {% endfor %}
                </td>
                <td>{{ message.body }}</td>
                <td>{{ message.creationDate ? message.creationDate|date('Y-m-d H:i:s') : '' }}</td>
                <td>
                    <a href=\"{{ path('app_message_show', {'id': message.id}) }}\">show</a>
                    <a href=\"{{ path('app_message_edit', {'id': message.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"4\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('app_message_new') }}\">Create new</a>
{% endblock %}
